%script

BEGIN DBMS_DATA_MINING.DROP_MODEL('AI_EXPLAIN_OUTPUT');
EXCEPTION WHEN OTHERS THEN NULL; END;
/
DECLARE
    v_setlst DBMS_DATA_MINING.SETTING_LIST;
BEGIN
    v_setlst('ALGO_NAME')        := 'ALGO_AI_MDL';
    V_setlst('PREP_AUTO')        := 'ON';

    DBMS_DATA_MINING.CREATE_MODEL2(
        MODEL_NAME        => 'AI_EXPLAIN_OUTPUT',
        MINING_FUNCTION   => 'ATTRIBUTE_IMPORTANCE',
        DATA_QUERY        => 'select * from CUST_INSUR_LTV_BIN_V',
        SET_LIST          => v_setlst,
        CASE_ID_COLUMN_NAME => 'CUST_ID',
        TARGET_COLUMN_NAME  => 'LTV_BIN');
END;

%script

DECLARE
  v_sql varchar2(200);
  v_setlst DBMS_DATA_MINING.SETTING_LIST;

BEGIN

-- Drop model

BEGIN
    v_sql := 'CALL DBMS_DATA_MINING.DROP_MODEL(''N1_CLASS_MODEL'')';
    EXECUTE IMMEDIATE v_sql;
    DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
    WHEN OTHERS THEN
    DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no model exists');
END;

BEGIN
    v_sql := 'CALL DBMS_DATA_MINING.DROP_MODEL(''N1_CLASS_MODEL_2'')';
    EXECUTE IMMEDIATE v_sql;
    DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
    WHEN OTHERS THEN
    DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no model exists');
END;


-- Drop apply result

BEGIN
    v_sql := 'DROP TABLE N1_APPLY_RESULT PURGE';
    EXECUTE IMMEDIATE v_sql;
    DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
    WHEN OTHERS THEN
    DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no table exists');
END;


-- Drop lift result

BEGIN
    v_sql := 'DROP TABLE N1_LIFT_TABLE PURGE';
    EXECUTE IMMEDIATE v_sql;
    DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
    WHEN OTHERS THEN
    DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no table exists');
END;

END;

%script

-- Build a classification model and then generate a lift test result and an apply result.
-- Split the Data into N1_TRAIN_DATA (randomly selected 60% of the data) and N1_TEST_DATA (remaining 40%)

BEGIN 

EXECUTE IMMEDIATE 'CREATE OR REPLACE VIEW N1_TRAIN_DATA AS SELECT * FROM CUST_INSUR_LTV_BIN_V SAMPLE (60) SEED (1)';
DBMS_OUTPUT.PUT_LINE ('Created N1_TRAIN_DATA');
EXECUTE IMMEDIATE 'CREATE OR REPLACE VIEW N1_TEST_DATA AS SELECT * FROM CUST_INSUR_LTV_BIN_V MINUS SELECT * FROM N1_TRAIN_DATA';
DBMS_OUTPUT.PUT_LINE ('Created N1_TEST_DATA');

END;

%script

-- Test the Model by generating an apply result and then create a lift result
BEGIN
  EXECUTE IMMEDIATE 'CALL DBMS_DATA_MINING.APPLY(''N1_CLASS_MODEL'',''N1_TEST_DATA'',''CUST_ID'',''N1_APPLY_RESULT'')';
  DBMS_OUTPUT.PUT_LINE ('Created apply result: N1_APPLY_RESULT ');
  EXECUTE IMMEDIATE 'CALL DBMS_DATA_MINING.COMPUTE_LIFT(''N1_APPLY_RESULT'',''N1_TEST_DATA'',''CUST_ID'',''LTV_BIN'',''N1_LIFT_TABLE'',''HIGH'',''PREDICTION'',''PROBABILITY'',100)';
  DBMS_OUTPUT.PUT_LINE ('Created lift result: N1_LIFT_TABLE ');
  END;
  /

%script

BEGIN

EXECUTE IMMEDIATE 'Drop Table CUST_INSUR_BEST_LTV';
EXCEPTION WHEN OTHERS THEN NULL;

EXECUTE IMMEDIATE 'CREATE Table CUST_INSUR_BEST_LTV as 
SELECT N1_APPLY_RESULT.CUST_ID, N1_APPLY_RESULT.PREDICTION PRED, ROUND(N1_APPLY_RESULT.PROBABILITY,3) PROB, N1_TEST_DATA.HOUSE_OWNERSHIP, N1_TEST_DATA.N_MORTGAGES, N1_TEST_DATA.MORTGAGE_AMOUNT, N1_TEST_DATA.MARITAL_STATUS
FROM N1_APPLY_RESULT, N1_TEST_DATA WHERE N1_APPLY_RESULT.CUST_ID=N1_TEST_DATA.CUST_ID AND N1_APPLY_RESULT.PREDICTION = ''HIGH'' AND N1_APPLY_RESULT.PROBABILITY > 0.5 
ORDER BY N1_APPLY_RESULT.PROBABILITY DESC';

END;
/
